import './App.css';
import {BrowserRouter as Routes, Route} from "react-router-dom";
import Navbar from './components';
function App() {
  return (
    <Routes>
      <div>
        <Navbar/>

          <Route path='/about' component={<Navbar/>} ></Route>
          <Route path='/users'></Route>
          <Route path='/'></Route>

     </div>
    </Routes>
  );
}

export default App;
